import React from "react";
import "./App.css";

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/questions")
      .then((res) => res.json())
      .then((data) => setData(data))
      .then(JSON.stringify(data))
      .then(console.log(data))});


return (
  <div>
  {data.map((`${data.question}`, `${data.correct}`))}
  </div>
);
}

export default App;
